var cursor = this.getObjectByName('cursor');
 var currentCamera = this.getObjectByName("sceneCamera");

var mouse = {x: 0, y: 0, z: 0};

function mousemove( event ) {
 event.preventDefault();
  mouse.x = event.clientX / window.innerWidth * 2 - 1;
  mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

  // Make the sphere follow the mouse
  var vector = new THREE.Vector3(mouse.x, mouse.y, 0);
  vector.unproject(currentCamera);
  var dir = vector.sub(currentCamera.position).normalize();
  var distance = -currentCamera.position.z / dir.z;
  var pos = currentCamera.position.clone().add(dir.multiplyScalar(distance));
    cursor.position.y = pos.y;
	cursor.position.x = pos.x;
    cursor.position.z = pos.z;
}

function update( event ) {
	currentCamera.aspect = window.innerWidth / window.innerHeight;
}

var allObjects = [
  "Ring_Social",	
  "Sphere_Client",
  "Bubble_Design",
  "Cylinder_Consulting",
  "Cube_Dev",
  "Sphere_Agence"
]

var vectorMouse = new THREE.Vector3(0, 0, 0);

var allForces = {};

var currentCamera = this.getObjectByName("sceneCamera");

var mouse = {x: 0, y: 0, z: 0};

function mousemove( event ) {
 event.preventDefault();
  mouse.x = event.clientX / window.innerWidth * 2 - 1;
  mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;

  // Make the sphere follow the mouse
  var vector = new THREE.Vector3(mouse.x, mouse.y, 0);
  vector.unproject(currentCamera);
  var dir = vector.sub(currentCamera.position).normalize();
  var distance = -currentCamera.position.z / dir.z;
  var pos = currentCamera.position.clone().add(dir.multiplyScalar(distance));
  vectorMouse = pos;
}

function update( event ) 
{  for (i = 0; i < allObjects.length ; i++) {
    currentObj = this.getObjectByName(allObjects[i]);
    if (currentObj && allForces[currentObj.name] === undefined) {
		console.log(currentObj.name);
      allForces[currentObj.name] = {
        xspeed: 0,
        yspeed: 0,
        xforce: 0,
        yforce: 0,
        mass: 20,
        vector: new THREE.Vector3(currentObj.position.x, currentObj.position.y, currentObj.position.z)
      };
    }
    resetAllForces(currentObj);
    applyMagnetForce(currentObj);
    getSpringForce(currentObj);
    applyFriction(currentObj);
    applyAllForces(currentObj);
    resetAllForces(currentObj);
  }
}

function applyMagnetForce(currentObject) {
  var dx = (vectorMouse.x - currentObject.position.x) * 1.2;
  var dy = (vectorMouse.y - currentObject.position.y) * 1.2;
  var distance = Math.sqrt(dx * dx + dy * dy);
  if (distance === 0) return;
  var force = 40 / (distance);

  //Find the horizontal and vertical components of the force
  var xforce = force * (dx / distance);
  var yforce = force * (dy / distance);
  //Apply forces to particles
  allForces[currentObject.name].xforce += -xforce;
  allForces[currentObject.name].yforce += -yforce;
}

function getSpringForce(currentObject) {
  var current_point = allForces[currentObject.name].vector;
  var dx = currentObject.position.x - current_point.x;
  var dy = currentObject.position.y - current_point.y;
  var distance = Math.sqrt(dx * dx + dy * dy);
  var force = 0.3 * (distance);
  //Find the horizontal and vertical components of the force
  if (distance === 0) return;
  var xforce = - force * (dx / distance);
  var yforce = - force * (dy / distance);
  //Apply forces to particles
  allForces[currentObject.name].xforce += xforce;
  allForces[currentObject.name].yforce += yforce;
}

function applyFriction(currentObject) {
  var s = Math.sqrt(allForces[currentObject.name].xspeed * allForces[currentObject.name].xspeed + allForces[currentObject.name].yspeed * allForces[currentObject.name].yspeed);
  var force = 0.6 * s;
  if (s === 0) return;
  //Find the horizontal and vertical components of the force
  var xforce = -force * (allForces[currentObject.name].xspeed / s);
  var yforce = -force * (allForces[currentObject.name].yspeed / s);
  //Apply forces to particles

  allForces[currentObject.name].xforce += xforce;
  allForces[currentObject.name].yforce += yforce;
}

function applyAllForces(currentObject) {
  allForces[currentObject.name].xspeed += allForces[currentObject.name].xforce / allForces[currentObject.name].mass;
  allForces[currentObject.name].yspeed += allForces[currentObject.name].yforce / allForces[currentObject.name].mass;
  currentObject.position.x += allForces[currentObject.name].xspeed;
  currentObject.position.y += allForces[currentObject.name].yspeed;
}

function resetAllForces(currentObject) {
  allForces[currentObject.name].xforce = 0;
  allForces[currentObject.name].yforce = 0;
}

function resetAll(currentObject) {
  resetAllForces();
  allForces[currentObject.name].xspeed = 0;
  allForces[currentObject.name].yspeed = 0;
}
